function BellowNav() {
    const navigate = useNavigate()
  return (
    <div className='bellowNav'>
<div className='bellowNavImgDiv'>
<img onClick={()=>{
    navigate("/")
}} className='bellowNavImg' src={Logo}></img>
</div>
<MiniProfile/>
  
  <div className='bellowNavSearch'>
    <input type="text"></input>
    <button>Search</button>
  </div>


<div className="bellowNavBTNS">
<button  onClick={()=>navigate("/SingUpForm")

}>Register</button>
<button onClick={()=>{navigate("/LoginForm")
Axios.get("http://localhost:5000/SingUpForm").then((res)=>{
    console.log(res)
})}

}>Login</button>
<i class="fa-solid fa-basket-shopping"></i>
</div>
    </div>
  )
}

export default BellowNav
